import OperatorsList from "../components/operatorsListComponent/OperatorsList"
import { useState } from 'react'

const MainPage = () => {
    const [counter, increment] = useState(0)


    return (
        <>
        <div>
            <OperatorsList/>
            {counter}
        </div>
            <div onClick={() => increment(counter+1)}>++++++</div>
        </>
    )
}

export default MainPage
